import React from "react";

const Alert = (props) => {
  
  return (
    <div style={{height:'50px'}}>
     {props.alert && <div className="alert alert-primary" role="alert">
      <strong></strong>:{props.alert.msg}
      
        {props.message}
      </div>}
    </div>
  );
};

export default Alert;
